	(5273, '_transient_dash_4077549d03da2e451c8b5f002294ff51', '<div class="rss-widget"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2016/01/contributor-weekend-support-forums/\'>Contributor Weekend: Support Forums</a> <span class="rss-date">22 gennaio 2016</span><div class="rssSummary">Our first global contributor drive is coming up next weekend, January 30-31, 2016, and we want you to be involved! Many of our current contributors first got involved at a Contributor Day at a WordCamp or WordPress Meetup event near them, but not everyone has had that opportunity, so we’re trying to create an online experience that [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=\'rsswidget\' href=\'http://wptavern.com/first-wordpress-meetup-in-karachi-draws-125-attendees\'>WPTavern: First WordPress Meetup in Karachi Draws 125 Attendees</a></li><li><a class=\'rsswidget\' href=\'http://wptavern.com/your-chance-to-give-feedback-on-wordpress-accessibility-coding-standards\'>WPTavern: Your Chance to Give Feedback on WordPress’ Accessibility Coding Standards</a></li><li><a class=\'rsswidget\' href=\'https://ma.tt/2016/01/marketing-at-automattic/\'>Matt: Marketing at Automattic</a></li></ul></div><div class="rss-widget"><ul><li class=\'dashboard-news-plugin\'><span>Plugin popolari:</span> <a href=\'https://wordpress.org/plugins/wpclef/\' class=\'dashboard-news-plugin-link\'>Clef Two-Factor Authentication</a>&nbsp;<span>(<a href=\'plugin-install.php?tab=plugin-information&amp;plugin=wpclef&amp;_wpnonce=ba1428172c&amp;TB_iframe=true&amp;width=600&amp;height=800\' class=\'thickbox\' title=\'Clef Two-Factor Authentication\'>Installa</a>)</span></li></ul></div>', 'no'),
